    public boolean parserUrl(String response) {
        boolean isValidUrl;
        if (response != null && response.length() > 0 && response.contains("No such file or directory")) {
            isValidUrl = false;
        } else {
            isValidUrl = true;
        }
        return isValidUrl;

    }

    public String[] parsePs(String response) {
        String[] pid = null;
        if (response != null && response.length() > 0) {
            String content = response.toString().replace("\r", "\n");
            String[] lines = content.split("\\n+");
            if (lines.length <= 2) {
                pid = null;
            } else {
                for (String line : lines) {
                    if (!line.contains(" grep ")) {
                        pid = new String[2];
                        pid[0] = line.split("\\s+")[1];
                        pid[1] = line.split("\\s+")[0];
                        break;
                    }
                }
            }
        }

        return pid;

    }

    public boolean parserExistUser(String response, String user) {
        boolean isValidUrl;
        if (response != null && response.length() > 0 && response.contains(user)) {
            isValidUrl = true;
        } else {
            isValidUrl = false;
        }
        return isValidUrl;

    }

