    public String getContentBlock(String input, String regexSplit, String content) {
        Pattern p = Pattern.compile(regexSplit);
        String[] arrString = p.split(input);
        for (String str : arrString) {
            if (str.contains(content)) {
                return str;
            }
        }
        return null;
    }

