    public String surroundOperator(String input, String startRegex, String stopRegex) {
        String regex = "(" + startRegex + ")+.+(" + stopRegex + ")";
        String rplRegex = "(" + startRegex + ")|(" + stopRegex + ")";
        Pattern pattern = Pattern.compile(regex);
        Matcher matcher = pattern.matcher(input);
        String result = "";
        if (matcher.find()) {
            result = matcher.group().replaceAll(rplRegex, "");
        }
        return result;
    }

    public List<String> delimitedExtractor(String input, String delimiterRegex, int keep, String contain, String excuted) {
        List<String> result = new ArrayList<String>();
        try {
            if ((0 == keep) && contain == null && excuted == null) {
                result = Arrays.asList(input.split(delimiterRegex));
            } else if ((0 == keep) && contain != null && excuted == null) {
                String[] arr = input.split(delimiterRegex);
                for (String str : arr) {
                    if (constains(str, contain, true)) {
                        result.add(str);
                    }
                }
            } else if ((0 == keep) && contain != null && excuted != null) {
                String[] arr = input.split(delimiterRegex);
                for (String str : arr) {
                    if (constains(str, contain, true) && !constains(str, excuted, true)) {
                        result.add(str);
                    }
                }
            } else if (1 == keep && contain == null && excuted == null) {
                result = Arrays.asList(input.split("(?=" + delimiterRegex + ")"));
            } else if (1 == keep && contain != null && excuted != null) {
                String[] arr = input.split("(?=" + delimiterRegex + ")");
                for (String str : arr) {
                    if (constains(str, contain, true) && !constains(str, excuted, true)) {
                        result.add(str);
                    }
                }
            } else if (1 == keep && contain != null && excuted == null) {
                String[] arr = input.split("(?=" + delimiterRegex + ")");
                for (String str : arr) {
                    if (constains(str, contain, true)) {
                        result.add(str);
                    }
                }
            }

        } catch (Exception e) {
            logger.error(e.getMessage(), e);
        }
        return result;
    }

    public List<String> getContentExtractor(String input, String regex, int position) {
        List<String> listResult = new ArrayList<String>();
        Pattern pattern = Pattern.compile(regex, Pattern.UNIX_LINES | Pattern.CASE_INSENSITIVE | Pattern.MULTILINE);
        Matcher matcher = pattern.matcher(input);
        while (matcher.find()) {
            String str = matcher.group(position);
            listResult.add(str);
        }
        return listResult;
    }

    public List<String> getContentExtractorReplace(String input, String regex, String rplRegex) {
        List<String> listResult = new ArrayList<String>();
        Pattern pattern = Pattern.compile(regex, Pattern.CASE_INSENSITIVE | Pattern.MULTILINE | Pattern.COMMENTS);
        Matcher matcher = pattern.matcher(input);
        while (matcher.find()) {
            String str = matcher.group().replaceAll(rplRegex, "");
            listResult.add(str);
        }
        return listResult;
    }

    public Set<String> getContentNotOverlap(String input, String regex) {
        Set<String> listResult = new HashSet<String>();
        Pattern pattern = Pattern.compile(regex, Pattern.CASE_INSENSITIVE | Pattern.MULTILINE | Pattern.COMMENTS);
        Matcher matcher = pattern.matcher(input);
        while (matcher.find()) {
            String str = matcher.group();
            listResult.add(str);
        }
        return listResult;
    }

    public boolean constains(String input, String content, boolean isRegex) {
        if (isRegex) {
            Pattern p = Pattern.compile(content, Pattern.CASE_INSENSITIVE);
            Matcher m = p.matcher(input);
            return m.find();
        } else {
            return input.contains(content);
        }
    }

    //Regex lay thong tin
    //response : du lieu dau vao, regex: chuoi regex, indexGroup: theo () 
    public String findLineWithRegex(String response, String regex, int indexGroup) {
        String result = "";
        try {
            if (response != null && !response.trim().isEmpty()) {
                Pattern p = Pattern.compile(regex);

                List<String> listResult = new ArrayList<>();
                Matcher m = p.matcher(response);

                while (m.find()) {
                    listResult.add(m.group(indexGroup));
                }
                if (listResult.size() > 0) {
                    result = listResult.get(0).trim();
                }
            }
        } catch (Exception e) {
            logger.error(e.getMessage(), e);
        }
        return result;
    }

    public String findLineWithRegexMultiline(String response, String regex, int indexGroup) {
        String result = "";
        try {
            if (response != null && !response.trim().isEmpty()) {
                Pattern p = Pattern.compile(regex, Pattern.MULTILINE);

                List<String> listResult = new ArrayList<String>();
                Matcher m = p.matcher(response);

                while (m.find()) {
                    listResult.add(m.group(indexGroup));
                }
                if (listResult.size() > 0) {
                    result = listResult.get(0);
                }
            }
        } catch (Exception e) {
            logger.error(e.getMessage(), e);
        }
        return result;
    }

    public List<String> findWithRegexMultiline(String response, String regex, int indexGroup) throws Exception {
        List<String> listResult = new ArrayList<>();
        try {
            if (response != null && !response.trim().isEmpty()) {
                Pattern p = Pattern.compile(regex, Pattern.CASE_INSENSITIVE | Pattern.MULTILINE | Pattern.COMMENTS);

                Matcher m = p.matcher(response.trim());

                while (m.find()) {
                    listResult.add(m.group(indexGroup));
                }
            }
        } catch (Exception e) {
            throw e;
        }
        return listResult;
    }

    public String matchesOperator(String input, String regex, int index) {
        ArrayList<String> result = new ArrayList<String>();
        Pattern pattern = Pattern.compile(regex, Pattern.CASE_INSENSITIVE | Pattern.MULTILINE | Pattern.COMMENTS);
        Matcher matcher = pattern.matcher(input);
        int i = 0;
        while (matcher.find()) {
            result.add(i, matcher.group());
            i++;
        }
        if (result.size() > 0) {
            return result.get(index);
        } else {
            return "";
        }

    }

    public List<String> matchesOperatorArrays(String input, String regex) {
        ArrayList<String> result = new ArrayList<String>();
        Pattern pattern = Pattern.compile(regex, Pattern.CASE_INSENSITIVE | Pattern.MULTILINE | Pattern.COMMENTS);
        Matcher matcher = pattern.matcher(input);
        int i = 0;
        while (matcher.find()) {
            result.add(i, matcher.group());
            i++;
        }
        return result;
    }

    public String replaceNull(String input) {
        if (input != null) {
            return input;
        }
        return "";
    }

    public int indexOf(Pattern pattern, String s) {
        Matcher matcher = pattern.matcher(s);
        return matcher.find() ? matcher.end() : -1;
    }

    public void getElementPolicy(String input, List<String> srcAddrs, List<String> dstAddrs, List<String> services) {
        String policyRegex = "from+\\s+\\\"+.+to+.+";
        String regex = "\\\"+[\\w\\s\\d_\\.\\/\\-@\\(\\)\\[\\]\\$\\%\\^\\&\\#\\*\\+]+\\\"";
        String rSrcAddr = "set\\ssrc-address+.+";
        String rDstAddr = "set\\sdst-address+.+";
        String rService = "set\\sservice +.+";

        String policy = matchesOperator(input, policyRegex, 0);
        List<String> tmpArr = matchesOperatorArrays(policy, regex);

        List<String> tmpSrcAddr = matchesOperatorArrays(input, rSrcAddr);
        List<String> tmpDstAddr = matchesOperatorArrays(input, rDstAddr);
        List<String> tmpServices = matchesOperatorArrays(input, rService);

        if (tmpSrcAddr.size() > 0) {
            srcAddrs.add(tmpArr.get(2));
            for (String addr : tmpSrcAddr) {
                srcAddrs.add(subStringAfter(addr, "set src-address "));
            }
        } else {
            srcAddrs.add(tmpArr.get(2));
        }

        if (tmpDstAddr.size() > 0) {
            dstAddrs.add(tmpArr.get(3));
            for (String addr : tmpDstAddr) {
                dstAddrs.add(subStringAfter(addr, "set dst-address "));
            }
        } else {
            dstAddrs.add(tmpArr.get(3));
        }

        if (tmpServices.size() > 0) {
            services.add(tmpArr.get(tmpArr.size()));
            for (String sv : tmpServices) {
                services.add(subStringAfter(sv, "set service "));
            }
        } else {
            services.add(tmpArr.get(tmpArr.size()));
        }
    }

    public static String getShellPromptSpecial(String shell) {
        if (shell != null) {
            shell = shell.trim();
            if ("\\$".equals(shell)) {
                shell = shell.replace("\\", "");
            }
        }
        return shell;
    }

    public Date getCurrentDate() {
        Calendar cal = Calendar.getInstance();
        return cal.getTime();
    }

    public static String getFullPath(String path) {
        if (path.startsWith("/") && !path.endsWith("/"))
            return path + "/";
        else
            return path;
    }

